create table Cars_Sold (
	car_Sold_ID INT,
	car_for_Sale_ID INT  UNIQUE,
	customer_ID INT,
	agreed_Price INT,
	date_Sold DATE,
	monthly_Payment_Amount INT,
	monthly_Payment_Date DATE,
	PRIMARY KEY(car_Sold_ID),
	FOREIGN KEY(car_for_Sale_ID) REFERENCES Cars_for_Sale(car_for_sale_ID),
	FOREIGN KEY(customer_ID) REFERENCES Customers(customer_ID)
);
